export const pythonCode = `import sys
sys.setrecursionlimit(128000)

class Solution:
    def selectionSort(self, nums):
        # Loop through unsorted part
        # of the array (0 to n-2)
        for i in range(len(nums) - 1):
            ''' Assume current
            element is minimum '''
            min_index = i

            '''Find actual minimum in
            unsorted part (i+1 to n-1) '''
            for j in range(i + 1, len(nums)):
                if nums[j] < nums[min_index]:
                    min_index = j

            ''' Swap only if minIndex
            changed (optimization) '''
            if min_index != i:
                nums[i], nums[min_index] = nums[min_index], nums[i]

        return nums


if __name__ == "__main__":
    t = int(input())
    for _ in range(t):

        testCase = input()
        print(testCase)
        n = int(input())
        nums = list(map(int, input().split()))
        s = Solution()
        ans = s.selectionSort(nums)
        print(' '.join(map(str, ans)))
`;

